import React from 'react';
import './style.css';
import 'semantic-ui-css/semantic.min.css';
import { Header, Segment, Container, Tab } from 'semantic-ui-react';

const panes = [
  { menuItem: '料金', render: () => <Tab.Pane><ul>
      <li>移動と撮影時間に対して、5000円／1h</li>
      <li>上記に加え、移動費用のご負担をお願い致します！</li>
      <li></li>
    </ul></Tab.Pane> },
  { menuItem: 'Tab 2', render: () => <Tab.Pane>Tab 2 Content</Tab.Pane> },
  { menuItem: 'Tab 3', render: () => <Tab.Pane>Tab 3 Content</Tab.Pane> },
]

function Request() {
  return (
      <div>
        <br/>
        <Container>
          <Segment>
            <Header as = "h1" textAlign = 'centered'>モデル撮影依頼</Header>
            <p>僕としては、写真撮影は大好きなので、本当は全て引き受けたいのですが、需要の調整ということでご容赦ください
            </p>
            <Tab panes = {panes}/>
          </Segment>
        </Container>

      </div>
  );
}

export default Request;
